import React, {Component} from 'react'
import Typography from "@material-ui/core/Typography";
import {withRouter} from "react-router-dom";
import CompositionList from "./CompositionList";
import {connect} from "react-redux";
import SecondaryLayout from "../_layouts/default/SecondaryLayout";
import Container from "@material-ui/core/Container";
import styled from "styled-components";

const PageCaptionSpacer = styled.div`
    padding: ${({theme}) => theme.spacing(4, 0)};
`

class CompositionsContainer extends Component {

    constructor(props) {
        super(props)
        this.state = {
            compositions: props.compositions,
        }
    }

    render() {
        return (
            <SecondaryLayout>
                <PageCaptionSpacer>
                    <Container maxWidth="xl">
                        <Typography component="h1" variant="h5" align="left" color="textPrimary">
                            Листинг композиций
                        </Typography>
                    </Container>
                </PageCaptionSpacer>

                <CompositionList compositions={this.state.compositions}/>
                <div>
                    <style scoped>
                        @import url("//portal.fondy.eu/mportal/static/saas/fondy/css/style.css")
                    </style>
                    <a className="btn btn-lg btn-success" target="_blank" href="https://api.fondy.eu/s/sJf5sdUE4mFyEh">
                        <i className="fa fa-credit-card"></i> Платежная страница
                    </a>
                </div>
            </SecondaryLayout>
        )
    }
}

const mapStateToProps = (store) => ({
    compositions: store.compositionsPage.compositions
})

export default connect(mapStateToProps)(withRouter(CompositionsContainer))
